script: |
  super -f text -I q11017.spq | sort > q11017.out

inputs:
  - name: q11017.spq
    data: |
      SELECT - 90 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE + col0 * + col0 NOT BETWEEN NULL AND - - col2;
  - name: tab0

outputs:
  - name: q11017.out
    data: |
      -90
      -90
      -90
